import React from 'react';
import {BrowserRouter as Router, Routes, Route  } from 'react-router-dom';
import "./App.css"
import login from './page/Home/login';

const App = () => {
  return ( 
    <Router>
       <Routes>
          <Route path='/' element={login}/>
       </Routes>
    </Router>
   );
}

export default App;
